import React, { useEffect } from 'react'
import './ItsMe.css'
import me from './Image/me.jpg';

import AOS from 'aos';
import 'aos/dist/aos.css';
function Teachers() {
    useEffect(() => {
        AOS.init();
    }, [])
    return (
        <>
        <div className="mebox">
<div className="myphoto">
    <img src={me} alt='me' className='me'/>
</div>
        </div>
        
        </>
    )
}

export default Teachers
